// CreateAccount2.jsx

import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Logo from '../Components/Logo.jsx';
import InputEmail from '../Components/InputEmail.jsx';
import BouttonContinuez from '../Components/BouttonContinuez.jsx';
import './CreateAccount2.css';

function CreateAccount2 () {

   const navigate = useNavigate();
   const handleBack = () => {
      // Naviguez vers la page précédente
      navigate(-1);
  };

   return (
      <div>
         <button className="back-button" onClick={handleBack}>
            <img src="/iconButtons.svg" alt="Retour" />
         </button>

         <div className="header-section">
            <h2>Créez un compte</h2>
            <img src="/BarreDEtat2.png" alt="Barre d'Etat" />
         </div>

         <Logo />

         <p className='entrez-email'>Veuillez renseigner votre adresse mail</p>

         <InputEmail />

         <Link to="/create-account-3" className="botoncont"> <BouttonContinuez /> </Link>

      </div>
   )
}
export default CreateAccount2;
